import React from "react";

const Extraimg = () => {
    const [sameim, setSameim] = useState([""]);

    useEffect(() => {
        fetch(
          `https://pixabay.com/api/?key=38320105-b762e964374d782b30b2f8654&q=${singpagedeta[0].tags}`
        )
          .then((res) => res.json())
          .then((sameitm) => {
            console.log(sameitm);
            setSameim(sameitm.hits);
          });
      });

  return (
    <>
       <div className="same-img">
          <div className="img-deta-same">
            {sameim.map((res) => {
              return (
                <>
                  <div
                    className="img-res"

                    onClick={() => {navigate(`/${res.id}`)}}
                    key={res.id}
                  >
                    <img
                      className="on-img"
                      src={res.webformatURL}
                      alt="img.jpg"
                    />
                  </div>
                </>
              );
            })}
          </div>
        </div>
    </>
  );
};

export default Extraimg;
